      <input id="toggle-all" className="toggle-all" type="checkbox" />
      <label htmlFor="toggle-all">Mark all as complete</label>
      <ul className="todo-list">
        {
          list.map(item)
        }
      </ul>
    </section>
  )
}

export default TodoMain
